import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div className="expenses_one">
      <div className="date">October 5</div>
      <div>
        <h2 className="expenses_text">Car Insurance</h2>
        <div className="expenses_amount">$230.34</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
